import React, { FunctionComponent } from "react";
import Event from "../../../models/event";
import "./style.css"

type Props = {
    events: Array<Event>
};

const OrgaTable: FunctionComponent<Props> = ({ events }) => {
    return (
        <div className="mt50">
            <h2 className="blue pl25">Event users :</h2>
            <ul>
                {events.map(user => (
                    <li className="flex-row flex-center flex-bet">
                        <p>{user.name}</p>
                        <p>{user.date}</p>
                        <p>{user.locality}</p>
                        <p>{user.maxPlace}</p>
                        <p>{user.dispoPlace}</p>
                        <i className="material-icons">edit</i>
                    </li>
                ))}
            </ul>
        </div>
    )
}

export default OrgaTable
